    <Box display = {"flex"}>
        <Box name = "step1"
         sx={{
            background: colors.redAccent[500],
            borderRadius: "100%",
            width: "50px",
            height: "50px",
            margin: "5px"
        }}></Box>

    </Box>
  )
}
